import { View, Text } from 'react-native'
import React from 'react'

const ScreenPlayGame = () => {
  return (
    <View>
      <ImageBackground source={require('../assets/bc2.png')} style={{width:'100%',height:'100%'}}>
        
        </ImageBackground>
        <View><Text>Long </Text>
        
        </View>
    </View>
  )
}

export default ScreenPlayGame
